import React, { Component } from 'react';

class Watchlist extends Component {

  constructor() {
    super();
    this.state = {
      watchlist : [],
      isLoaded: false
    }
  }

  componentDidMount() {
    fetch('http://127.0.0.1:5070/watchlist')
      .then(res => res.json())
      .then(result => {
        this.setState({
          isLoaded: true,
          watchlist: result
        });
      });
  }

  render() {
    const {watchlist} = this.state;
    return (
      <div>
        {watchlist.map(list1 => (
          <h3>{list1.id}</h3>
        ))}
      </div>
    );
  } 
}

export default Watchlist;
